import React, { Component } from 'react';

class Home extends Component {

  componentDidMount(){

    map = new google.maps.Map(document.getElementById('map'), {
      center: {lat: -34.397, lng: 150.644},
      zoom: 1
    });

  }


  render() {

const { lat, lng } = this.props;

    return (
<div>
<span>{lat}</span>
<span>{lng}</span>

<div id="map"></div>

</div>

    );
  }
}

export default Home;
